import React from 'react'

export default function Resume() {
  return (
    <div>

        <div class="resume-item pb-0">
            <h4>Alice Barkley</h4>
            <p><em>Innovative and deadline-driven Graphic Designer with 3+ years of experience designing and developing user-centered 
                digital/print marketing material from initial concept to final, polished deliverable.</em></p>
                <p></p><ul><li>Portland par 127,Orlando, FL</li><li>(123) 456-7891</li><li>alice.barkley@example.com</li></ul><p></p>
        </div>



    </div>
  )
}
